import React from 'react';
import { Switch, Route } from 'react-router-dom';
import Landing from './LandingPage';
import LandingPage from './LandingPage'

const Main = () => {
    <Switch>
        <Route exact path= "/" componant= {Landing} />
    </Switch>
}

export default Main;
